import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Import Route
import Signup from './pages/Signup.js';

function App() {
  return (
    <Router>
      <Route path="/signup" component={Signup} />
    </Router>
  );
}

export default App;
